import React, {useState, useEffect} from 'react';
import './App.css';
import {Button} from 'react-bootstrap';
import MyProfile from './Profiles/MyProfiles/Index';
import {BrowserRouter as Router, Route, Link} from 'react-router-dom';

function App() {
  return (
    <div className="App">
    <Router>
      <Link to="/" >Home</Link>
      <Link to={
        {
          pathname:"/about",
          state: {
            from :"root"
          }
        }
      } >nav1</Link>
      <Link to="/nav2" >nav2</Link>
      <Link to="/nav3" >nav3</Link>
      <Route exact path="/" render={() => <div>Home</div>}/>
      <Route exact path="/nav1" render={() => <div>nav1</div>}/>
      <Route exact path="/nav2" render={() => <div>nav2</div>}/>
      <Route exact path="/nav3" render={() => <div>nav3</div>}/>
    </Router>
    <MyProfile/>
    </div>
  );
}

export default App;
